// Tighten SEC 100m/200m recruit and walk-on standards (keep target unchanged)
(() => {
  const recruitDelta = 0.10; // seconds faster
  const walkonDelta = 0.21;  // seconds faster
  const tighten = (evt: EventStandards) => {
    const t = parseFloat(evt.target);
    let r = parseFloat(evt.recruit) - recruitDelta;
    let w = parseFloat(evt.walkon) - walkonDelta;
    if (!Number.isFinite(t) || !Number.isFinite(r) || !Number.isFinite(w)) return;
    if (r <= t) r = parseFloat((t + 0.01).toFixed(2));
    if (w <= r) w = parseFloat((r + 0.01).toFixed(2));
    evt.recruit = r.toFixed(2);
    evt.walkon = w.toFixed(2);
  };

  schoolStandards.forEach((s) => {
    if (s.conference !== "SEC") return;
    const applyGroup = (group?: Record<string, EventStandards>) => {
      if (!group) return;
      ["100m", "200m"].forEach((e) => {
        const evt = group[e];
        if (evt) tighten(evt);
      });
    };
    applyGroup(s.maleStandards);
    applyGroup(s.femaleStandards);
  });
})();

// Gulf South Conference schools added using La Salle standards
(() => {
  const ref = schoolStandards.find((s) => s.schoolName === "La Salle University");
  if (!ref) return;

  const cloneGroup = (g?: Record<string, EventStandards>) =>
    g ? (JSON.parse(JSON.stringify(g)) as Record<string, EventStandards>) : undefined;

  const schools = [
    { id: "gsc_alabama_huntsville", schoolName: "Alabama-Huntsville", state: "AL" },
    { id: "gsc_lee_tn", schoolName: "Lee (TN)", state: "TN" },
    { id: "gsc_mississippi_college", schoolName: "Mississippi College", state: "MS" },
    { id: "gsc_montevallo", schoolName: "Montevallo", state: "AL" },
    { id: "gsc_west_alabama", schoolName: "West Alabama", state: "AL" },
    { id: "gsc_trevecca_nazarene", schoolName: "Trevecca Nazarene", state: "TN" },
    { id: "gsc_christian_brothers", schoolName: "Christian Brothers", state: "TN" }
  ];

  schools.forEach((info) => {
    schoolStandards.push({
      id: info.id,
      schoolName: info.schoolName,
      division: "D2",
      conference: "Gulf South",
      state: info.state,
      maleStandards: cloneGroup(ref.maleStandards),
      femaleStandards: cloneGroup(ref.femaleStandards) as Record<string, EventStandards>
    });
  });

  // Adjust Gulf South Conference standards - make high jump easier and 110m hurdles easier
  schoolStandards.forEach((school) => {
    if (school.conference === "Gulf South") {
      // Make men's high jump easier by 3 inches each tier
      if (school.maleStandards && school.maleStandards["High Jump"]) {
        school.maleStandards["High Jump"] = {
          target: "6'4\"",
          recruit: "6'2\"", 
          walkon: "6'0\""
        };
      }
      
      // Make women's high jump easier by 3 inches each tier
      if (school.femaleStandards && school.femaleStandards["High Jump"]) {
        school.femaleStandards["High Jump"] = {
          target: "5'3\"",
          recruit: "5'2\"",
          walkon: "5'1\""
        };
      }
      
      // Make men's 110m hurdles easier
      if (school.maleStandards && school.maleStandards["110m Hurdles"]) {
        school.maleStandards["110m Hurdles"] = {
          target: "14.65",
          recruit: "14.95",
          walkon: "15.50"
        };
      }
    }
  });
})();

