// Add American Rivers Conference (A-R-C) schools using Adams State standards
(() => {
  const adams = schoolStandards.find(
    (s) => s.id === "rmac_adams_state" || s.schoolName === "Adams State University"
  );
  if (!adams) return;

  // Helper function to make standards 1% easier
  const makeEasier = (performance: string, event: string): string => {
    // Time-based events (lower is better) - increase by 1%
    const isTimeBased = event.includes('m') && !event.includes('Jump') && !event.includes('Put') && !event.includes('Throw') && !event.includes('Discus') && !event.includes('Hammer') && !event.includes('Javelin') && !event.includes('athlon');
    
    // Handle time formats (mm:ss.xx or ss.xx)
    if (performance.includes(':')) {
      const [minutes, seconds] = performance.split(':');
      const totalSeconds = parseInt(minutes) * 60 + parseFloat(seconds);
      const newSeconds = totalSeconds * 1.01; // 1% slower (easier)
      const newMinutes = Math.floor(newSeconds / 60);
      const remainingSeconds = (newSeconds % 60).toFixed(2);
      return newMinutes > 0 ? `${newMinutes}:${remainingSeconds.padStart(5, '0')}` : remainingSeconds;
    }
    
    // Handle distance formats with feet and inches
    const straightApostrophe = "'";
    const curlyApostrophe = "\u2019";
    const straightQuote = '"';
    const curlyQuote = "\u201D";
    if (performance.includes(straightApostrophe) || performance.includes(straightQuote) || 
        performance.includes(curlyApostrophe) || performance.includes(curlyQuote)) {
      const feetMatch = performance.match(/(\d+)[\u0027\u2019]/);
      const inchMatch = performance.match(/(\d+)[\u0022\u201D]/);
      const feet = feetMatch ? parseInt(feetMatch[1]) : 0;
      const inches = inchMatch ? parseInt(inchMatch[1]) : 0;
      const totalInches = feet * 12 + inches;
      
      if (isTimeBased) {
        // This shouldn't happen for distance formats, but handle it
        const newInches = Math.round(totalInches * 1.01);
        const newFeet = Math.floor(newInches / 12);
        const remainingInches = newInches % 12;
        return `${newFeet}'${remainingInches}"`;
      } else {
        // Distance/height events (higher is better) - decrease by 1% (making it easier to achieve)
        const newInches = Math.round(totalInches * 0.99);
        const newFeet = Math.floor(newInches / 12);
        const remainingInches = newInches % 12;
        return `${newFeet}'${remainingInches}"`;
      }
    }
    
    // Handle regular numbers (points for decathlon/heptathlon)
    const numericValue = parseFloat(performance.replace(/[^\d.]/g, ''));
    if (!isNaN(numericValue)) {
      if (isTimeBased) {
        return (numericValue * 1.01).toFixed(2);
      } else {
        // For points and other distance events, make easier (lower requirement)
        return Math.round(numericValue * 0.99).toString();
      }
    }
    
    return performance; // Return original if can't parse
  };

  // Helper function to apply easier standards to all events
  const applyEasierStandards = (standards: Record<string, EventStandards>): Record<string, EventStandards> => {
    const easierStandards: Record<string, EventStandards> = {};
    
    Object.keys(standards).forEach(event => {
      easierStandards[event] = {
        target: makeEasier(standards[event].target, event),
        recruit: makeEasier(standards[event].recruit, event),
        walkon: makeEasier(standards[event].walkon, event),
      };
    });
    
    return easierStandards;
  };

  type Meta = { id: string; schoolName: string; division: string; conference: string; state: string; makeEasier?: boolean };
  const arcSchools: Meta[] = [
    { id: "arc_central_college", schoolName: "Central College", division: "D3", conference: "American Rivers Conference", state: "IA" },
    { id: "arc_university_of_dubuque", schoolName: "University of Dubuque", division: "D3", conference: "American Rivers Conference", state: "IA" },
    { id: "arc_loras_college", schoolName: "Loras College", division: "D3", conference: "American Rivers Conference", state: "IA" },
    { id: "arc_nebraska_wesleyan", schoolName: "Nebraska Wesleyan University", division: "D3", conference: "American Rivers Conference", state: "NE" },
    { id: "arc_simpson_college", schoolName: "Simpson College", division: "D3", conference: "American Rivers Conference", state: "IA", makeEasier: true },
    { id: "arc_buena_vista", schoolName: "Buena Vista University", division: "D3", conference: "American Rivers Conference", state: "IA", makeEasier: true },
    { id: "arc_luther_college", schoolName: "Luther College", division: "D3", conference: "American Rivers Conference", state: "IA", makeEasier: true },
    { id: "arc_coe_college", schoolName: "Coe College", division: "D3", conference: "American Rivers Conference", state: "IA", makeEasier: true },
  ];

  arcSchools.forEach((meta) => {
    const maleStandards = adams.maleStandards ? (meta.makeEasier ? applyEasierStandards({ ...adams.maleStandards }) : { ...adams.maleStandards }) : undefined;
    const femaleStandards = meta.makeEasier ? applyEasierStandards({ ...adams.femaleStandards }) : { ...adams.femaleStandards };

    schoolStandards.push({
      ...meta,
      maleStandards,
      femaleStandards,
    });
  });
})();

// Add WIAC schools using University of South Alabama standards
(() => {
  const southAlabama = schoolStandards.find(
    (s) => s.id === "89" || s.schoolName === "University of South Alabama"
  );
  if (!southAlabama) return;

  type WIACMeta = { id: string; schoolName: string; division: string; conference: string; state: string };
  const wiacSchools: WIACMeta[] = [
    { id: "wiac_uw_whitewater", schoolName: "University of Wisconsin-Whitewater", division: "D3", conference: "WIAC", state: "WI" },
    { id: "wiac_uw_la_crosse", schoolName: "University of Wisconsin-La Crosse", division: "D3", conference: "WIAC", state: "WI" },
    { id: "wiac_uw_eau_claire", schoolName: "University of Wisconsin-Eau Claire", division: "D3", conference: "WIAC", state: "WI" },
    { id: "wiac_uw_oshkosh", schoolName: "University of Wisconsin-Oshkosh", division: "D3", conference: "WIAC", state: "WI" },
    { id: "wiac_uw_river_falls", schoolName: "University of Wisconsin-River Falls", division: "D3", conference: "WIAC", state: "WI" },
    { id: "wiac_uw_platteville", schoolName: "University of Wisconsin-Platteville", division: "D3", conference: "WIAC", state: "WI" },
    { id: "wiac_uw_stout", schoolName: "University of Wisconsin-Stout", division: "D3", conference: "WIAC", state: "WI" },
    { id: "wiac_uw_stevens_point", schoolName: "University of Wisconsin-Stevens Point", division: "D3", conference: "WIAC", state: "WI" },
  ];

  // Schools with hardened sprint standards (La Crosse, Eau Claire, Oshkosh, Whitewater)
  const hardenedSchoolIds = ["wiac_uw_la_crosse", "wiac_uw_eau_claire", "wiac_uw_oshkosh", "wiac_uw_whitewater"];
  
  // Schools to ease standards slightly (make ~0.5% easier)
  const easedSchoolIds = ["wiac_uw_stout", "wiac_uw_stevens_point"];

  // Helper to ease standards by percentage
  const easeStandardsByPct = (
    standards: Record<string, EventStandards> | undefined,
    timePct = 0.005,
    distPct = 0.005
  ): Record<string, EventStandards> | undefined => {
    if (!standards) return standards;

    const isDistance = (val: string) => val.includes("'") || val.includes('"') || val.includes("\u2019") || val.includes("\u201D");
    const isTime = (val: string) => val.includes(":") || /\d+\.\d+/.test(val);

    const formatTime = (totalSeconds: number) => {
      const minutes = Math.floor(totalSeconds / 60);
      const seconds = totalSeconds - minutes * 60;
      const secStr = seconds < 10 ? `0${seconds.toFixed(2)}` : seconds.toFixed(2);
      return minutes > 0 ? `${minutes}:${secStr}` : seconds.toFixed(2);
    };

    const adjustValue = (event: string, val: string): string => {
      // Points-based events
      if (event === "Decathlon" || event === "Heptathlon") {
        const n = parseFloat(val.replace(/[^\d.]/g, ""));
        if (Number.isNaN(n)) return val;
        const adjusted = Math.round(n * (1 - distPct) / 10) * 10; // nearest 10
        return String(adjusted);
      }

      // Distances (feet/inches)
      if (isDistance(val)) {
        const feetMatch = val.match(/(\d+)[\u0027\u2019]/);
        const inchMatch = val.match(/(\d+)[\u0022\u201D]/);
        const feet = feetMatch ? parseInt(feetMatch[1], 10) : 0;
        const inches = inchMatch ? parseInt(inchMatch[1], 10) : 0;
        const totalInches = feet * 12 + inches;
        const newInches = Math.max(0, Math.round(totalInches * (1 - distPct)));
        const newFeet = Math.floor(newInches / 12);
        const newRemInches = newInches % 12;
        return `${newFeet}'${newRemInches}\"`;
      }

      // Times (ss.xx or mm:ss.xx)
      if (isTime(val)) {
        if (val.includes(":")) {
          const [mStr, sStr] = val.split(":");
          const minutes = parseInt(mStr, 10);
          const seconds = parseFloat(sStr);
          const total = minutes * 60 + seconds;
          const adjusted = total * (1 + timePct);
          return formatTime(adjusted);
        }
        const seconds = parseFloat(val);
        if (Number.isNaN(seconds)) return val;
        return parseFloat((seconds * (1 + timePct)).toFixed(2)).toFixed(2);
      }

      return val;
    };

    const result: Record<string, EventStandards> = {};
    Object.entries(standards).forEach(([event, ev]) => {
      result[event] = {
        target: adjustValue(event, ev.target),
        recruit: adjustValue(event, ev.recruit),
        walkon: adjustValue(event, ev.walkon),
      };
    });
    return result;
  };
  
  wiacSchools.forEach((meta) => {
    const baseStandards = {
      maleStandards: southAlabama.maleStandards ? { ...southAlabama.maleStandards } : undefined,
      femaleStandards: { ...southAlabama.femaleStandards },
    };

    // Apply hardened standards for specific schools
    if (hardenedSchoolIds.includes(meta.id) && baseStandards.maleStandards) {
      baseStandards.maleStandards["100m"] = { target: "10.32", recruit: "10.52", walkon: "10.71" };
      baseStandards.maleStandards["200m"] = { target: "20.93", recruit: "21.23", walkon: "21.52" };
      baseStandards.maleStandards["400m"] = { target: "46.56", recruit: "47.25", walkon: "47.93" };
      
      baseStandards.femaleStandards["100m"] = { target: "11.49", recruit: "11.79", walkon: "12.08" };
      baseStandards.femaleStandards["200m"] = { target: "23.67", recruit: "24.06", walkon: "24.45" };
      baseStandards.femaleStandards["400m"] = { target: "53.80", recruit: "54.68", walkon: "56.74" };
    }

    // Apply easing for Stout and Stevens Point
    if (easedSchoolIds.includes(meta.id)) {
      if (baseStandards.maleStandards) {
        baseStandards.maleStandards = easeStandardsByPct(baseStandards.maleStandards);
      }
      baseStandards.femaleStandards = easeStandardsByPct(baseStandards.femaleStandards)!;
    }

    schoolStandards.push({
      ...meta,
      ...baseStandards,
    });
  });
})();

